{"author": "Tuyết Ngân", "author_url": "https://mbasic.facebook.com/tuyetngan.daquyphongthuy?rc=p&__tn__=R", "text": "Tâm Lê k hiểu xuất phát của nó thì nghĩ là bẩn thôi :) Cụm từ này là bọn 3 vạch phản động nó nghĩ ra đầu tiên, mỉa mai rằng Tổ quốc ta hèn kém và k có chủ quyền, không phát triển. Nhưng cư dân mạng thay vì cãi nhau vs lũ 3 sọc, đã bình tĩnh ghi nhận luôn cái tên Đông Lào, để cno hiểu rằng VN ta khi đi với bụt sẽ mặc áo cà sa, khi đi vs ma sẽ mặc áo giấy mà thôi", "reply_to": "Tuyết Ngân"}
{"author": "Phúc Châu", "author_url": "https://mbasic.facebook.com/phuc.chau.54966?rc=p&__tn__=R", "text": "Tâm Lê cái đó là 1 phần thôi. East Laos Empire là nc đéo ngán bố con thằng đế cuốc nào đấy =)))) Đập chết tươi bọn Fap, hất cẳng bọn Mẽo và đặc biệt chấm dứt sự tồn tại của đất nc đu càng bằng những tiếng \" bằng bằng \" của ak-47 =)))))", "reply_to": "Tuyết Ngân"}
