{"author": "Trần Hải Đăng", "author_url": "https://mbasic.facebook.com/lighthouse95?rc=p&__tn__=R", "text": "Đông Lào là 1 đế chế nằm ở miền viễn đông Vương Quốc Lào yên bình, tươi đẹp, còn nó ra sao thì chỉ một bộ phận loài người trên hành tinh này biết thôi, những người trong cuộc khi nghe thấy cái tên Đ*** L** là đã thấy kinh hồn bạt vía, đến cái tên còn k giám nhắc đến trực tiếp, vì cái gì, tất nhiên là những thứ kinh khủng nó đã làm trong lịch sử và quyền lực áp chế của nó lên các vùng đất lân cận. Theo những gì còn thu được, cái tên Đông Lào sinh ra là bởi vương quốc Lào tươi đẹp đã luôn là 1 người anh em tốt, luôn trung thành của đế chế, đã có lúc đã muốn dâng hiến cả vương quốc mà trở thành 1 phần của đế chế, tuy nhiên người anh đế chế hiểu rõ được cái gì là độc lập, là tồn tại của 1 dân tộc nên đã khuyên nhủ người em về xây dựng vương quốc ấm no hơn, giàu đẹp hơn. Qua những gì đc nghe ng ta sẽ ngờ ngợ nghĩ ngay đến Việt Nam, nhưng tuyệt nhiên khi nhắc đến Việt Nam thi k 1 ai có ấn tượng gì sâu sắc.", "reply_to": "Tuyết Ngân"}
